            if (searchType === 'N Casa') {
                values = [...new Set(houseDataNCasa.map(entry => entry['N Casa']))];
            } else if (searchType === 'Proprietario') {
                values = [...new Set(houseDataProprietario.map(entry => entry['Proprietario']))];
            } else if (searchType === 'Quadra-Lote') {
                values = [...new Set(houseDataQuadraLote.map(entry => entry['Quadra'].toString() + '-' + entry['Lote'].toString()))];
            }

            values.forEach(value => {
                const option = document.createElement('option');
                option.value = value;
                option.text = value;
                searchValueSelect.appendChild(option);
            });
        }

        searchTypeSelect.addEventListener('change', updateSearchValues);
        updateSearchValues();

        document.getElementById('qrForm').addEventListener('submit', function(event) {
            event.preventDefault();
            var searchType = searchTypeSelect.value;
            var searchValue = searchValueSelect.value;

            var entry = null;
            if (searchType === 'N Casa') {
                entry = houseDataNCasa.find(entry => entry['N Casa'].toString() === searchValue);
            } else if (searchType === 'Proprietario') {
                entry = houseDataProprietario.find(entry => entry['Proprietario'] === searchValue);
            } else if (searchType === 'Quadra-Lote') {
                entry = houseDataQuadraLote.find(entry => (entry['Quadra'].toString() + '-' + entry['Lote'].toString()) === searchValue);
            }

            if (!entry) {
                alert('Endereço não encontrado!');
                return;
            }

            var wkt = entry['WKT'];
            var coordinates = wkt.match(/-?\d+\.\d+/g);
            var destination = coordinates.slice(-2).reverse().join(',');

            var googleMapsUrl = `https://www.google.com/maps/dir/?api=1&origin=Portaria+Bougainville+Residence+Prive&destination=${destination}`;

            var qrDiv = document.getElementById('qrcode');
            qrDiv.innerHTML = "";

            var img = document.createElement('img');
            img.src = `https://api.qrserver.com/v1/create-qr-code/?size=150x150&data=${encodeURIComponent(googleMapsUrl)}`;
            qrDiv.appendChild(img);
        });
    </script>
</body>
</html>
